import React from "react";

class MenuList extends React.Component {
  handleOnlickHome = () => {
    alert("commm");
  };
  render() {
    return (
      <>
        <ul class="breadcrumb">
          <li>
            <a
              onClick={() => {
                this.handleOnlickHome();
              }}
            >
              Home
            </a>
          </li>
          <li>
            <a href="#">Todo</a>
          </li>
        </ul>
      </>
    );
  }
}
export default MenuList;
